export function getIconComponent<T extends IconType>(
  type: T,
  name: IconNameByType[T]
): IconComponentType | undefined {
  const typeModule = iconMap[type];
  for (const category in typeModule) {
    if (Object.prototype.hasOwnProperty.call(typeModule, category)) {
      const icons = typeModule[category] as Record<string, IconComponentType>;
      if (icons && name in icons) {
        return icons[name];
      }
    }
  }
  return undefined;
}
